import Button from "./button";
import { GoBell } from 'react-icons'

function App() {
    return <div>
        <div><Button success rounded outline>click me</Button></div>
        <div><Button danger outline>HIIIII!!</Button></div>
        <div><Button warning>NOPE</Button></div>
        <div><Button secondary outline>SHOP</Button></div>
        <div><Button secondary>KLOPP!!</Button></div>
        
    </div>
}

export default App;
